import { useState } from 'react'; 
import './Sidebar.css';
import {Link} from 'react-router-dom';

const Sidebar = () => {
  const[activeLink, setActiveLink] = useState('');
  return (
    <div className='side-bar'>
      <ul>
        <li onClick={()=>setActiveLink('dash')} className={`${activeLink === 'dash' && 'active'}`}><Link to='/admin-dashboard' className='d-flex align-items-center gap-2 p-3'><i className="fa-solid fa-house fa-fw"></i> Dashboard</Link></li>
        <li onClick={()=>setActiveLink('appoint')} className={`${activeLink === 'appoint' && 'active'}`}><Link to='/all-appointments' className='d-flex align-items-center gap-2 p-3'><i className="fa-solid fa-calendar-days fa-fw"></i> Appointments</Link></li>
        <li onClick={()=>setActiveLink('add')} className={`${activeLink === 'add' && 'active'}`}><Link to='/add-doctor' className='d-flex align-items-center gap-2 p-3'><i className="fa-solid fa-plus fa-fw"></i> Add Doctor</Link></li>
        <li onClick={()=>setActiveLink('list')} className={`${activeLink === 'list' && 'active'}`}><Link to='/doctor-list' className='d-flex align-items-center gap-2 p-3'><i class="fa-solid fa-users fa-fw"></i> Doctors List</Link></li>
      </ul>
    </div>
  )
}

export default Sidebar
